import { StyleSheet } from "react-native";

const whButtonStyles = StyleSheet.create({
    buttonStyle: {
      justifyContent: "center",
      alignItems: "center",
      backgroundColor: "#59f0a9",
      height: 40,
      width: 190,
      borderRadius: 5,
      marginTop: 30,
    },
    buttonText: {
      color: "black",
      fontSize: 23,
      fontFamily: "HelveticaRegular",
    },
  });

  module.exports = whButtonStyles;
